Morning coffee and a light read. Peeling through the pages of my upcoming book for the last pass. It's been a stack of papers for a long time and it really came to life with this mock bound copy. From start to finish, this book is jam packed with a TON of content; life stories, training and competing strategies, movement demos, workouts, journal entry questions and even recipes. #HWPO #FRA5ER⁠
-⁠
The book is available for preorder now in the US, UK, Australia and more. Print & delivery set for JANUARY 2022. Click the link in bio to preorder now.⁠
